import React from 'react';
import './styles.css';

function Header() {
  return (
    <header>
      <div className="header-content">
        <h1>ExchangeRate</h1>
        <nav>
          <a href="#">Dashboard</a>
          <a href="#">Converter</a>
          <a href="#">Chart</a>
          <a href="#">About Me</a>
        </nav>
      </div>
    </header>
  );
}

function UserInput() {
  return (
    <label>
      文本框：<input name="myInput" />
    </label>
  );
}

function Converter() {
  return (
    <div className="Converter">
      <div className="Converter-title">Converter</div>
      <div className="Converter-body">
        <UserInput />
        <UserInput />
      </div>
    </div>
  );
}

function App() {
